import About from './Components/about'
import Work from './Components/work'
import Contact from './Components/contact'
import NavbarHeader from './Components/navbarHeader';
import {AnimatePresence, motion} from 'framer-motion'




function App() {
  return (
    <Router>
      <NavbarHeader/>
      <Route
        render={({location}) => (
          <Switch location={location} key={location.pathname}>
            <Route exact path='/' render={() => <Home imageDetails={imageDetails}/>}/>
            <Route path='/about' render={() => <About imageDetails={imageDetails}/>}/>
            <Route path='/work' render={() => <Work imageDetails={imageDetails}/>}/>
            <Route path='/contact' render={() => <Contact imageDetails={imageDetails}/>}/>
          </Switch>
        )}
          />


      </Router>
  );
}

export default App;
